I have a list of strings that I want to sort case-sensitively. I'm using the following code:
var myList = ['a', 'B', 'c', 'A'];
myList.sort();
console.log(myList);
// Outputs ['A', 'B', 'a', 'c']
// But I want [ 'A', 'a', 'B', 'c']
How can I sort case-sensitively?
marked as duplicate by Bergi  javascript May 1 '15 at 15:00
You can use a custom sort function:
var myList = ['a', 'B', 'c', 'A'];
myList.sort(function(a, b) {
    if (a.toLowerCase() < b.toLowerCase()) return -1;
    if (a.toLowerCase() > b.toLowerCase()) return 1;
    if (a < b) return -1;
    if (a > b) return 1;
console.log(myList);
// Outputs ["A", "a", "B", "c"]
This function will only return 0 if the two elements being compared are exactly the same (i.e. the two elements are the same index; this is a requirement of the sort function). Otherwise, it converts the elements to lower case and compares them. If they're the same, then it compares the original elements to see which should go first.
