 and "\#" as shown below. The number of rows in the pattern is determined by the user input. The pattern should be displayed using nested loops.

```
Enter the number of rows: 5
*#*#*
*#*#*
*#*#*
*#*#*
*#*#*
```

Solution:Here is a possible implementation of this program in Java:

```java
import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner scan = new Scanner(System.in);
        System.out.print("Enter the number of rows: ");
        int n = scan.nextInt();

        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= n; j++) {
                if ((i + j) % 2 == 0) {
                    System.out.print("*");
                } else {
                    System.out.print("#");
                }
            }
            System.out.println();
        }
    }
}
```
