. The function should take in a date object representing the time the post was made and return a string in the format "X minutes ago" or "X hours ago" or "X days ago" depending on how long ago the post was made.

For example, if the post was made 5 minutes ago, the function should return "5 minutes ago". If the post was made 2 hours ago, the function should return "2 hours ago". If the post was made 3 days ago, the function should return "3 days ago".

You can assume that the date object passed to the function is in the past.

Solution: Here is a possible implementation of this function in TypeScript:
```typescript
function getElapsedTime(postDate: Date): string {
  const now = new Date();
  const diffInSeconds = Math.abs(now.getTime() - postDate.getTime()) / 1000;

  if (diffInSeconds < 60) {
    return `${Math.round(diffInSeconds)} seconds ago`;
  } else if (diffInSeconds < 3600) {
    return `${Math.round(diffInSeconds / 60)} minutes ago`;
  } else if (diffInSeconds < 86400) {
    return `${Math.round(diffInSeconds / 3600)} hours ago`;
  } else {
    return `${Math.round(diffInSeconds / 86400)} days ago`;
  }
}
```
