I'm trying to make a text-based game in Java, and I'm having trouble with the dialogue system. I want to be able to have multiple choice dialogue, but I'm not sure how to implement it. I've tried using a switch statement, but it's not working the way I want it to. Can anyone help me out?
Here's an example of what I'm trying to do:
System.out.println("You come across a fork in the road. Which way do you go?");
System.out.println("1. Left");
System.out.println("2. Right");
int choice = scan.nextInt();
switch(choice) {
    System.out.println("You go left and find a treasure chest.");
    System.out.println("You go right and find a dragon.");
    System.out.println("Invalid choice.");
I want to be able to have multiple choices, and have the game respond differently depending on the choice the player makes. But I'm not sure how to do that. Any help would be appreciated!
You can use a nested switch statement to handle multiple choices. Here's an example:
System.out.println("You come across a fork in the road. Which way do you go?");
System.out.println("1. Left");
System.out.println("2. Right");
int choice = scan.nextInt();
switch(choice) {
    System.out.println("You go left and find a treasure chest.");
    System.out.println("Do you want to open the chest?");
    System.out.println("1. Yes");
    System.out.println("2. No");
    int choice2 = scan.nextInt();
    switch(choice2) {
        System.out.println("You open the chest and find a sword.");
        System.out.println("You leave the chest alone.");
    System.out.println("You go right and find a dragon.");
    System.out.println("Do you want to fight the dragon?");
    System.out.println("1. Yes");
    System.out.println("2. No");
    int choice3 = scan.nextInt();
    switch(choice3) {
        System.out.println("You fight the dragon and win.");
        System.out.println("You run away from the dragon.");
    System.out.println("Invalid choice.");
In this example, the player has two choices at the fork in the road. If they choose to go left, they find a treasure chest and have the option to open it. If they choose to go right, they find a dragon and have the option to fight it. The nested switch statements allow for multiple choices and different outcomes depending on the player's choices.

